创建一个简单的教务系统界面，我们可以使用HTML的基本结构和一些基本元素。这里给出一个基本的教务信息管理页面示例：

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>教务系统</title>
    <style>
        /* 基本样式，你可以根据需要添加更具体的CSS */
        body {
            font-family: Arial, sans-serif;
            padding: 20px;
        }
        h1, label {
            display: block;
            margin-bottom: 10px;
        }
        input[type="text"], select {
            width: 100%;
            padding: 5px;
            margin-bottom: 10px;
        }
        button {
            padding: 10px 20px;
            background-color: #4CAF50; /* 可自定义颜色 */
            color: white;
            border: none;
            cursor: pointer;
        }
    </style>
</head>
<body>
    <h1>教务管理系统</h1>
    <form>
        <label for="studentName">学生姓名:</label>
        <input type="text" id="studentName" name="studentName" required>

        <label for="courseName">课程名称:</label>
        <select id="courseName" name="courseName" required>
            <!-- 自定义课程选项，例如： -->
            <option value="">请选择课程</option>
            <option value="Mathematics">数学</option>
            <option value="Physics">物理</option>
        </select>

        <button type="submit">提交</button>
    </form>
</body>
</html>
```

这个例子中，我们创建了一个包含学生姓名和课程名称输入表单的简单教务系统。你可以根据实际需求添加更多的表单字段（如学生ID、成绩等），以及处理表单提交的JavaScript代码。

注意：这只是一个静态HTML页面，要实现完整的功能，还需要后端服务器来处理数据（如PHP、Node.js、Python等）和数据库存储。
